import React, { Component } from 'react'
import Navigation from '../../Containers/Navigation/Navigation'
import './Contact.scss'

class Contact extends Component {
    render() {
        return(
            <div>
                <Navigation />
                <div className="contact-header">
                    <h1>Contact</h1>

                </div>
            </div>
        )
    }
}

export default Contact
